    "description": "<p><u>Intradermal Botulinum Toxin for the Reduction of Sebum Production and Pore Size</u></p><p>In this presentation, we will investigate whether intradermal injections of botulinum toxin (“microtoxin”) may improve skin quality and assess the effectiveness of microtoxin for the improvement of sebum levels and pore size count. This presentation will look at a case series of patients treated with intradermal botulinum toxin and assessed at four weekly intervals to examine change in pore count and sebum production as a measure of oiliness.</p><p><u>Skin Quality And Skin Rejuvenation With Revive + How Revive Fits Into Your Practice</u></p><p>The unique qualities of Revive / How Revive has predictable results that last longer due to the CPM technology, cross-linked HA and the addition of glycerol.</p><p><b style=\"font-size: 1rem;\">Presented by</b><b><span style=\"font-size: 1rem;\">&nbsp;</span>Dr Stephen Lowe &amp;&nbsp;<span style=\"font-size: 1rem;\">Freya Carlsen</span></b></p><p><b style=\"font-size: 1rem;\">Brought to you by Merz</b></p>",
